    //retailer functions
    function addnewItemToInvt(string memory name,uint256 catId,uint256 price,uint256 quantity,address payable sellerId,uint256 itemId) public {
        //check if itemID exists
        for (uint256 i = 0; i < itemIds.length; i++) {
